            <!--parte 1-->

            <div id=""aula-pt1"">

                <p class=""texto"">
                    Podemos dizer que o JavaScript é como o vento. Você não o vê, mas pode sentir.
                    Quer dizer, na verdade você o vê, só não sabia disso até esse momento.
                </p>
                <p class=""texto"">
                    A partir de agora, você será capaz de ver o JavaScript em qualquer lugar da internet. <span style=""color: #3bff14"">Plim!!</span>
                </p>
                <p class=""texto"">
                    Quer fazer uma coisa legal? Digite o que está escrito abaixo no editor ao lado.
