                    Massa, né? Você acabou de usar o JavaScript para fazer isso...
                </p>
                <p class=""texto"">
                    O <span style=""color: #3bff14"">JavaScript</span> é uma linguagem de programação que te permite realizar várias funções.
                    É ele quem faz o seu computador pensar, na maior parte do tempo.
                    Existem outras linguagens por aí, mas ele é mais legal :P
                </p>
                <p class=""texto"">
                    Vamos tentar outra coisinha. Escreva isso:
                </p>
