                </p>
                <p class=""texto"">
                    Se quiser deixar seus códigos mais arrumadinhos, você pode fazer um comentário usando <span style=""color: #3bff14"">//</span>, assim:
                </p>
                <p class=""texto-teste"" id=""texto-aula"">
                    //Alerta no topo da página <br>
                    alert(""✍(◔◡◔)"")
                </p>


                <div class=""butns"">
