                <p class=""texto"">
                    Vamos lá. Você tem duas galinhas de estimação, a Cassandra e a Odete.
                    ");
                WriteLiteral(@"A Cassandra botou 6 ovos em um dia, enquanto a Odete botou 4. Quantos ovos elas botaram no total?
                </p>
                <p class=""texto"">
                    Fazer cálculos em JavaScript é bem fácil. Lembre-se de colocar o <span style=""color: #3bff14"">console.log()!</span>
                </p>
                <p class=""texto-teste"" id=""texto-aula"">
                    console.log(6 + 4)
                </p>
                <p class=""texto"">
                    E então? Teremos muitos pintinhos logo, logo!
                </p>
                <p class=""texto"">
                    Continuando. Vamos supor que tenha 3 amigos com você,
                    e vocês precisam dividir 24 balinhas de morango entre os 4.
                    Quantas balinhas cada um ganharia?
                </p>
                <p class=""texto-teste"" id=""texto-aula"">
                    console.log(24 / 4)
                </p>
                <p class=""texto"">
                    E se você tivesse mais");
