                </p>
                <p class=""texto-teste"" id=""texto-aula"">
                    console.log(7 * 6)
                </p>
                <p class=""texto"">
                    Viu como é simples?
                </p>
                <p class=""texto"">
                    Aqui a lista de operadores matemáticos: <br>
                    -> (+) soma <br>
                    -> (-) subtração <br>
                    -> (*) multiplicação <br>
